import SignUp from './SignUp';
import SignIn from './SignIn';

const routes = {
    unauthenticated: [
        {
            path: '/auth/signin',
            content: 'Sign In',
            component: SignIn
        },
        {
            path: '/auth/signup',
            content: 'Sign Up',
            component: SignUp
        }],
    authenticated: [
        {
            path: '/auth/logout',
            content: 'Logout',
            component: null
        }]
}

export default routes;
